import React from 'react';

import ErrorBoundry from '../error-boundry';
import Spinner from '../spinner';

const App = () => {
    return(
        <ErrorBoundry>
            <Spinner />
            <h1>Hello World</h1>
        </ErrorBoundry>
    );
}

export default App;
